from scrapy.utils.python import to_unicode

def rel_has_nofollow(rel):
    """Return True if link rel attribute has nofollow type"""
    if not rel:
        return False
    rel_str = to_unicode(rel).lower()
    rel_values = {v.strip() for v in rel_str.split()}
    return 'nofollow' in rel_values
